1. Banana is a good source of carbohydrate, vitamins and minerals like pottasium and phosphorus.
2. Bananas rich in soluble fiber,pectin eases the digestion and helps to prevent constipation.
3. Bananas rich in pottasium helps to regulate blood pressure.
4. Banana skin is a good natural medicine for allergies and infection caused by mosquito bite.
5. Banana contains vitamin B6.it act as a anti-inflammatory agent.
6. Banana contains fructooligosaccharide.it helps in calcium absorption and promotes bone health.
7. Bananas have natural antacid effects therefore it aids in treating ulcer, stomach irritation, acidity and heartburns.
